import React, { Component } from 'react';
import { connect } from 'react-redux';
import { getCoffee } from '../../actions';

class CoffeeDelete extends Component {
	componentDidMount() {
		this.state.getCoffee(this.props.match.params.id);
	}

	render() {
		return <div>Are you sure you want to delete this?</div>;
	}
}

mapStateToProps = state => {
	console.log(state);
};

export default connect(mapStateToProps, { getCoffee })(CoffeeDelete);
